package org.openapitools.server.model


/**
 * Represents the url or the content of an image generated by the OpenAI API.
 *
 * @param b64Json The base64-encoded JSON of the generated image, if `response_format` is `b64_json`. for example: ''null''
 * @param url The URL of the generated image, if `response_format` is `url` (default). for example: ''null''
 * @param revisedPrompt The prompt that was used to generate the image, if there was any revision to the prompt. for example: ''null''
*/
final case class Image (
  b64Json: Option[String] = None,
  url: Option[String] = None,
  revisedPrompt: Option[String] = None
)

